name: Panasonic Rice Flour Bread (without wheat)
servings: 10 servings
source: Panasonic
prep_time: 10 min
cook_time: 2 hr 30 min 
categories: [Bread, Panasonic]
difficulty: Easy
nutritional_info: 136 calories
notes: |
  Use 5 ̊C cold water and reduce the amount of water by 10 g (mL) if the room temperature is above 25 ̊C.
ingredients: |
  270 g sticky flour and starch syrup
  300 g rice flour
  8.5 g sugar
  5   g salt
  8   g olive oil
  4.2 g instant dry yeast

  for syrup:
  1/2 tsp glutinous rice flour
  45  g   mizuame / corn syrup / agave nectar
  220 g   water
  1   tsp water
directions: |
  For Syrup:
  Put 1⁄2 teaspoon of glutinous flour into a deep heat-resistant container and dissolve with 1 teaspoon of water
  Put in microwave for 30-40 s at 600W (until it swells)
  Take out and stir and add 45g of mizuame and mix well
  Add 220g of water and mix well for a total of 270g


  For Bread:
  Remove the bread pan and Set the kneading blade
  Make glue and starch paste. (Not required when using mixed powder)
  Put glutinous rice flour and starch syrup (water when using mixed flour) in a bread case with bread wings set.
  Add rice flour, sugar and salt.
  Make a dimple on top of the powder and add olive oil there. (When using mixed flour, add shortening. You do not need to make dents.)
  Set the bread case in the main body and put dry yeast in the yeast container.
  Add instant dry yeast into yeast dispenser
  Select menu “18” via the メニュー (Menu) rocker
  To add mixins, press レーズン:選択 (Raisin: Select) , Select あり (Yes) (make it flash) for automatic add - raisins, nuts, green beans or olives (<100g) or Select あり♪ (Yes♪) (make it flash) for manual add - macerated vegetables, fruits, cheese or chocolate, before Start
  To use gentle stir for easily crushed mixins, after the above, Press レーズン:混ぜ (Raisin:Stir) and select 粗混ぜ (make it flash) - needed for olives, green beans, cheese, chocolate or heated vegetables
  To change crust color, press 焼き色 (Crust), to select 淡 (Light), 標準 (Standard), 濃 (Dark)
  For delayed start, press 予約 (Timer), and then 時 (hours) and/or 分 (minutes) to adjust end time
  Press スタート (Start)
  Baking completes (Beep sound)
  Take out the bread pan and put it on a table with a towelette under it. When handling the bread pan, be sure to wear thick oven gloves.
  Cool down (about 2 min)
  Take out the bread for cooling down
